import React, {Component} from "react";
import {withRouter} from "react-router-dom";


class Cookbook extends Component{
    constructor() {
        super();
        this.state = {}
    }
    add=()=>{
        this.props.history.push("/sosocook")
    }
    render() {
        return (<div className={"sosocook"}>
            <img alt={"标本"} onClick={this.add} className={"sosoimg"} src={"https://image.hongbeibang.com/FqkRcAKpMnFUL3qs1BB9aOhbihlj?80X80&imageView2/1/w/80/h/80"}/>
            <p className={"sosobtn"} onClick={this.add}>食谱分类</p>
        </div>)
    }

}

export default withRouter(Cookbook);
